currentSpectrum = {};

selectedSpectrum = 1;

selectedPeak = 0;

function on.activate()
    loadSpectrum(selectedSpectrum);
end

function on.paint(gc)
    drawSpectrum(gc, selectedSpectrum);
end

function on.arrowRight()
    selectedPeak = math.min(table.getn(currentSpectrum[4]), selectedPeak + 1);
    platform.window:invalidate();
end

function on.arrowLeft()
    selectedPeak = math.max(1, selectedPeak - 1);
    platform.window:invalidate();
end

function on.arrowDown()
    selectedSpectrum = math.min(table.getn(spectraDB), selectedSpectrum + 1);
    loadSpectrum(selectedSpectrum);
    platform.window:invalidate();
end

function on.arrowUp()
    selectedSpectrum = math.max(1, selectedSpectrum - 1);
    loadSpectrum(selectedSpectrum);
    platform.window:invalidate();
end

function on.escapeKey()
    selectedPeak = 0;
    platform.window:invalidate();
end

function loadSpectrum(i)
    selectedPeak = 0;
    for _i = 1, 5 do
        currentSpectrum[_i] = spectraDB[i][_i];
    end
    peakMap = {};
    for _i = 1, table.getn(currentSpectrum[4]) do
        peakMap[_i] = _i;
    end
    table.sort(peakMap, function(a, b) return currentSpectrum[4][a] < currentSpectrum[4][b] end);
    sortedPos = {};
    sortedVals = {};
    for _i = 1, table.getn(currentSpectrum[4]) do
        sortedPos[_i] = currentSpectrum[4][peakMap[_i]];
        sortedVals[_i] = currentSpectrum[5][peakMap[_i]];
    end
    currentSpectrum[4] = sortedPos;
    currentSpectrum[5] = sortedVals;
end

function drawSpectrum(gc)
    xMax = 0;
    yMax = 0;
    for _, x in ipairs(currentSpectrum[4]) do
        xMax = math.max(x, xMax);
    end
    for _, y in ipairs(currentSpectrum[5]) do
        yMax = math.max(y, yMax);
    end
    xScale = 290 / xMax;
    yScale = 190 / yMax;
 
    gc:setColorRGB(255, 0, 0);
    for _i, x in ipairs(currentSpectrum[4]) do
        scaledY = currentSpectrum[5][_i] * yScale;
        if selectedPeak == 0 or _i == selectedPeak then
            gc:setColorRGB(255, 0, 0);
        else
            gc:setColorRGB(150, 150, 150);
        end
        gc:drawLine(20 + x * xScale, 196 - scaledY, 20 + x * xScale, 196);
    end
    
    drawAxes(gc, xMax);
    
    gc:drawString(currentSpectrum[1], 25, 10);
    gc:drawString(currentSpectrum[2], 25, 21);
    gc:drawString("Mass: " .. currentSpectrum[3], 25, 32);
    
    if selectedPeak ~= 0 then
        peakData = tostring(currentSpectrum[5][selectedPeak]);
        gc:drawString("Selected m/z: " .. tostring(currentSpectrum[4][selectedPeak]), 25, 43);
        gc:drawString("Selected Intensity: " .. peakData, 25, 54);
        strWidth = gc:getStringWidth(peakData);
        borderX = 19 + currentSpectrum[4][selectedPeak] * xScale - strWidth / 2;
        borderY = math.max(183 - currentSpectrum[5][selectedPeak] * yScale, 70);
        gc:setColorRGB(255, 255, 255);
        gc:fillRect(borderX, borderY, strWidth + 2, 11);
        gc:setColorRGB(255, 0, 0);
        gc:drawRect(borderX, borderY, strWidth + 2, 11);
        gc:drawString(peakData, borderX + 2, borderY - 1, "top");
    end
end

function drawAxes(gc, xMax)
    gc:setFont("sansserif", "r", "6");
    
    gc:setColorRGB(0, 0, 255);

    gc:drawString(tostring(xMax), 300, 198);
    
    gc:setColorRGB(0, 0, 0);
    
    gc:drawString("100", 3, 5, "top");
    gc:drawString("75", 7, 53, "middle");
    gc:drawString("50", 7, 101, "middle");
    gc:drawString("25", 7, 149, "middle");
    for i = 1, 3 do
        gc:drawLine(17, 5 + 48 * i, 23, 5 + 48 * i);
    end
    
    xScale = 290 / xMax;
    for i = 0, xMax, 5 do
        if i % 2 == 0 then
            gc:drawLine(20 + i * xScale, 193, 20 + i * xScale, 199);
            if i < xMax - 9 then
                -- Prevent generated ticks from overlapping with the x-max value
                centerString(gc, tostring(i), 21 + i * xScale, 198, "top");
            end
        else
            gc:drawLine(20 + i * xScale, 194, 20 + i * xScale, 198);
        end
    end
    
    gc:drawRect(20, 6, 290, 190);
    
end

function centerString(gc, str, x, y, align)
    gc:drawString(str, x - gc:getStringWidth(str) / 2, y, align);
end

function dump(o)
   if type(o) == 'table' then
      local s = '{ '
      for k,v in pairs(o) do
         if type(k) ~= 'number' then k = '"'..k..'"' end
         s = s .. '['..k..'] = ' .. dump(v) .. ','
      end
      return s .. '} '
   else
      return tostring(o)
   end
end